◆商品詳細◆<br><br>
タイヤハウスをライトアップ！<br>
次のポイントはこれで決まり<br>
★防水LED<br>★広角LED18連ブルー光<br>
<br>防水処理されてますのでタイヤハウスやウエルカムランプとして使用できます。<br><br>
個性派のかたにオススメです！<br>
広角LED18連ですので非常に明るいです。<br>
配線はプラスとマイナスを接続するだけでOK！但し、配線は画像にある長さしか付属しませんので
ご用意ください。取付けはネジでの取り付けとなりますが、ネジ類は付属いたしません。こちらもご用意ください。<br><br>
基本的にはDIY商品となりますので予めご了承ください。 <br><br>
注意事項<br>
12V車専用<br>
1個の価格となります<br>
サイズは画像を参照ください<br>
JIS D 0203 浸水試験 D2相当の防水となります。水中では使用できません<br>
画像にある物が全てです。延長配線、ネジなどは付属いたしません<style type="text/css">
